    // The following example creates a marker in Stockholm, Sweden
    // using a DROP animation. Clicking on the marker will toggle
    // the animation between a BOUNCE animation and no animation.
    \$(document).ready(function (\$) {
        \"use strict\";
        var stockholm = new google.maps.LatLng(36.843697, 10.183814);
        var parliament = new google.maps.LatLng(36.843697, 10.183814);
        var image = '";
        // line 283
        echo twig_escape_filter($this->env, $this->env->getExtension('assets')->getAssetUrl("frontEnd/images/marker1.png"), "html", null, true);
        echo "';
        var marker;
        var map;

        function initialize() {
            var styleArray = [
        {
            featureType: 'all',
            stylers: [
            { saturation: -1000 }
            ]
        }, {
            featureType: 'road.arterial',
            elementType: 'geometry',
            stylers: [
            { hue: '#00ffee' },
            { saturation: -100 },
            { \"lightness\": -8 },
            { \"gamma\": 1.18 }
            ]
        }
        ];
            var mapOptions = {
                zoom: 18,
                styles: styleArray,
                center: stockholm
            };

            map = new google.maps.Map(document.getElementById('map_canvas'), mapOptions);

            marker = new google.maps.Marker({
                map: map,
                draggable: true,
                animation: google.maps.Animation.DROP,
                icon: image,
                position: parliament
            });
            google.maps.event.addListener(marker, 'click', toggleBounce);
        }

        function toggleBounce() {

            if (marker.getAnimation() != null) {
                marker.setAnimation(null);
            } else {
                marker.setAnimation(google.maps.Animation.BOUNCE);
            }
        }

        google.maps.event.addDomListener(window, 'load', initialize);

    });
</script>

